function BillMgt(){
    return(
        <div>
           <center><h3 className="border">Billing Manangement System</h3></center>
           <div className="navi">
            <h4>items</h4>
            <h4>Number of item</h4>
            <h4>Cost of item</h4>
           </div>
        </div>
    )
}
export default BillMgt;
